import React, { useEffect, useState } from "react";

const NavPanel = () => {
  return (
    <div>
      <div>Add GSM</div>
      <div>Add Shade</div>
      <div>No of High Defects</div>
      <div>Pass Fail Status</div>
      <div>Batch Status</div>
      <div>Report</div>
    </div>
  );
};

export default NavPanel;
